    `lower_bound_amount`      real NULL,
    `upper_bound_amount`      real NULL,
    `unit`                    text NOT NULL,
    `routeOfAdministrationId` text NULL,
    PRIMARY KEY (`id`),
    CONSTRAINT `route_of_administration_dosage_routeOfAdministrationId_fkey` FOREIGN KEY (`routeOfAdministrationId`) REFERENCES `substance_route_of_administration` (`id`) ON UPDATE CASCADE ON DELETE SET NULL
);
-- Copy rows from old table "substance_route_of_administration_dosage" to new temporary table "new_substance_route_of_administration_dosage"
INSERT INTO `new_substance_route_of_administration_dosage` (`id`, `unit`, `routeOfAdministrationId`)
SELECT `id`, `unit`, `routeOfAdministrationId`
